import React from 'react'

import '../../normalize.scss'
import '../../styles/base.scss'
import InitCadastro from '../../pages/InicioDoCadastro'
import View from "../view/view"

function Cadastro() {
  return (
    <View register={true}>
      <InitCadastro/>
    </View>
  )
}

export default Cadastro
